  [],\n\t\"revision_timestamp\": \"2016-07-27T22:58:07.193422\",\n\t\"name\": \"evaluation-of-the-status-of-anuran-metapopulations-on-a-refuge-in-suburban-maryland\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Because many anurans have well-defined
  breeding seasons and male anurans produce loud advertisement calls, surveys of these
  breeding choruses are believed to provide a dependable means of monitoring population
  trends. The Patuxent Research Refuge (PRR) initiated such a calling survey in the
  spring of 1997, which uses volunteers to collect anuran (frog and toad) calling
  survey data. The primary goal of initiating the calling surveys at PRR was to obtain
  baseline information on anuran populations, such as species occurrence, frequency
  of occurrence, and relative abundance over time. In this paper, we evaluated the
  data using multi-year site-occupancy models which determine the 'proportion of area
  occupied' (PAO) by anuran species over a specified period of time. Within the PAO
  framework, analysis is focused on the proportion of sites that are occupied by a
  species, instead of the number of individual anurans present in the population.
  Analysis based on PAO is ideal for use in large-scale monitoring programs focused
  on species that are difficult to count, such as anurans. This model also considers
  detection probability, that is, the probability that a particular species will be
  detected if it is present at a site. The data can be considered in conjunction with
  covariates to determine the optimal conditions under which each species is detectable.
  In the following paper, these considerations were modeled with covariates under
  a multi-year scheme. Findings from these PAO analyses indicate that anuran populations
  at PRR have high rates of occupancy compared to areas nearby and that extinction
  and colonization rates are stable.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
